import React from 'react'
import UpdateCompound from '../components/UpdateCompound'

const UpdatePage = () => {
    return (
        <div>
            <h1 className="text-center">Update Compounds</h1>
            <UpdateCompound />
        </div>
    );
};

export default UpdatePage;
